def sum_for_prime_factors(lst):

    def is_prime(n):
        if n < 1:
            return False
        if n <= 3:
            return True
        if n % 2 == 0 or n % 3 == 0:
            return False
        i = 5
        while i * i <= n:
            if n % i == 0 or n % (i + 2) == 0:
                return False
            i += 6
        return True
    factors = {i for k in lst for i in range(2, abs(k) + 1) if k % i == 0}
    prime_factors = {i for i in factors if is_prime(i)}
    return [[p, sum((e for e in lst if e % p == 0))] for p in sorted(prime_factors)]

